import React, { Component } from 'react';
import { Card, Table } from 'react-bootstrap';
import { FontAwesomeIcon } from '@fortawesome/react-fontawesome';
import { faCar, faPalette, faCalendarAlt, faDollarSign } from '@fortawesome/free-solid-svg-icons';

export default class VoitureListe extends Component {
  render() {
    return (
      <Card className="border border-dark bg-dark text-white">
        <Card.Header>
          <FontAwesomeIcon icon={faCar} /> Liste Voitures
        </Card.Header>
        <Card.Body>
          <Table bordered hover striped variant="dark" responsive>
            <thead>
              <tr>
                <th><FontAwesomeIcon icon={faCar} /> Marque</th>
                <th><FontAwesomeIcon icon={faCar} /> Modèle</th>
                <th><FontAwesomeIcon icon={faPalette} /> Couleur</th>
                <th><FontAwesomeIcon icon={faCalendarAlt} /> Année</th>
                <th><FontAwesomeIcon icon={faDollarSign} /> Prix</th>
              </tr>
            </thead>
            <tbody>
              <tr>
                <td colSpan="5" align="center">Aucune Voiture n’est disponible</td>
              </tr>
            </tbody>
          </Table>
        </Card.Body>
      </Card>
    );
  }
}
